import csvToJson from 'convert-csv-to-json';
import GroceryJSON from "../../Data/grocery_sampleJSON"
import FormItem from "./FormItem"

export class Item extends Component{
	constructor(props){
		super(props)
		let grocery = GroceryJSON
		console.log(grocery,"json")
	}
 


	render(){
		return(
			<div>
		<div>
			<h1>{this.props.supermarket_selected.name} {this.props.supermarket_selected.address}</h1>
		</div>
		<div>
		<FormItem/>	
		</div>
		</div>
		)
	}
}

export default Item
